INSERT INTO `note` (`id`, `action_id`, `espece_id`, `texte`, `mise_a_jour`) VALUES
(1, 1, 236, '<p>[Tito (<em>Perilla frutescens</em>) commun][Semis au chaud (18&deg;c)]</p>\r\n\r\n<p>faire des semis moins drue : <strong>3 &agrave; 5 graines par cm</strong></p>\r\n', '2022-04-26 17:33:31'),
(2, 32, 0, '[Variete ?][Plantation]<br><p>La planche Carbo est d&eacute;ja occup&eacute; pour faire des graine de Radis noir.</p>\r\n\r\n<p>A pr&eacute;voir dans les planifications</p>\r\n', '2022-04-26 17:30:17'),
(3, 0, 0, '[Variete ?][_Rien]<br><p>Spiral aromatique</p>\r\n\r\n<p>d&eacute;but de la construction</p>\r\n\r\n<ul>\r\n	<li>1/4 creus&eacute; : sud-est</li>\r\n	<li>1/4 tuile couch&eacute; nord -est</li>\r\n</ul>\r\n', '2022-04-30 19:38:01'),
(4, 2, 291, '[Courgette commun témoin][Semis sous abris : sous serre froide (10°c)]<br><p>courgette semis n&deg;357 : parfait timing :</p>\r\n\r\n<p>vari&eacute;t&eacute; verte noir mariach&egrave;re</p>\r\n', '2022-05-02 11:19:15'),
(5, 2, 360, '[Tomate commun][Semis sous abris : sous serre froide (10°c)]<br><p>Culture principal 100 pieds de tomate (besoins)</p>\r\n\r\n<ul>\r\n	<li>5 vari&eacute;t&eacute; cerises</li>\r\n	<li>1 vari&eacute;t&eacute; cocktail</li>\r\n	<li>2 vari&eacute;t&eacute; salades</li>\r\n	<li>2 vari&eacute;t&eacute; a farci</li>\r\n</ul>\r\n\r\n<p>100 pieds principale, 100 pieds de secours + le reste (max 100 pieds)</p>\r\n\r\n<p>Semis</p>\r\n\r\n<ul>\r\n	<li>Premier semis (15 f&eacute;vrier)</li>\r\n	<li>deuxi&egrave;me semis (01 mars)</li>\r\n	<li>dernier semis (si n&eacute;cessaire) 15 mars</li>\r\n</ul>\r\n\r\n<p>Repiquage en bac polystyr&egrave;ne (pas en godet individuel)</p>\r\n\r\n<p>Plantation</p>\r\n\r\n<ol>\r\n	<li>1er avril en serre 40 pieds</li>\r\n	<li>15 avril ext&eacute;rieur 30 pieds</li>\r\n	<li>30 avril 30 pieds</li>\r\n	<li>dernier 15 mai (si besoin en remplacement des mort) &agrave; prendre dans r&eacute;serve 1</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n', '2022-05-05 20:13:33'),
(6, 32, 364, '[Patate (conservation)][Plantation]<br><p>Besoin max</p>\r\n\r\n<ul>\r\n	<li>0,2 kg par jour pendant 365 jours (max) soit 73 kg</li>\r\n	<li>1 plant donne en moyenne 0,8 kg</li>\r\n	<li>Besoin : 92 plant</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n', '2022-05-05 20:22:40'),
(7, 2, 291, '<p>[Courgette commun t&eacute;moin][Semis sous abris : sous serre froide (10&deg;c)]</p>\r\n\r\n<p><strong>semis 359 : bon timing</strong></p>\r\n\r\n<ol>\r\n	<li>semis le 11/04/2022</li>\r\n	<li>plantation le 05/05/2022</li>\r\n</ol>\r\n', '2022-06-20 09:27:39'),
(8, 4, 180, '<p>[Piment commun][Semis ext&eacute;rieur : 5&deg;c]</p>\r\n\r\n<p><strong>Semis debut mars : bon timming</strong></p>\r\n', '2022-06-20 09:53:43'),
(9, 2, 382, '<p>[Petit pois nain][Semis sous abris : sous serre froide (10&deg;c)]</p>\r\n\r\n<p>Itin&eacute;raire petit pois :</p>\r\n\r\n<p>culture de petit pois jusqu&#39;a mi-juin fin juin</p>\r\n\r\n<p>semis de courgette 2i&egrave;me serie d&eacute;but juin / mi-juin</p>\r\n\r\n<p>&nbsp;</p>\r\n', '2022-06-20 09:53:54'),
(10, 256, 189, '<p>[Poireau d&#39;hiver][Fleuraison]</p>\r\n\r\n<ul>\r\n	<li>Pr&eacute;voir une planche pour les poireau en fleur</li>\r\n	<li>plantation de 50 poireaux pour graine</li>\r\n	<li>idem pour betterave, blette,&nbsp; carotte</li>\r\n</ul>\r\n', '2022-06-20 09:11:49'),
(11, 32, 360, '[Tomate commun][Plantation]<br><p>eviter de planter les tomates avec les piments ou aubergine car les tomate recouvre tout</p>\r\n', '2022-06-21 10:38:13'),
(12, 0, 0, '[Variete ?][_Rien]<br><p>Culture d&#39;hiver :</p>\r\n\r\n<p>r&eacute;colte de novembre &agrave; mars</p>\r\n\r\n<ul>\r\n	<li>poireau,</li>\r\n	<li>vari&eacute;t&eacute; oignon</li>\r\n	<li>chou fris&eacute;</li>\r\n	<li>chou pomm&eacute;es</li>\r\n	<li>chou chinois pe tsai park choi tatsoi</li>\r\n	<li>mizuna</li>\r\n	<li>roquette</li>\r\n	<li>tan &ocirc;</li>\r\n	<li>chicor&eacute;</li>\r\n	<li>scarole</li>\r\n	<li>chicor&eacute; fris&eacute;</li>\r\n	<li>chicor&eacute; pain de sucre</li>\r\n	<li>salade d&#39;hiver :\r\n	<ul>\r\n		<li>laitue &agrave; couper</li>\r\n		<li>laitue romaine</li>\r\n		<li>laitue pomm&eacute;es</li>\r\n	</ul>\r\n	</li>\r\n	<li>roquette</li>\r\n	<li>m&acirc;che</li>\r\n	<li>moutarde</li>\r\n	<li>clayton de cuba cresson</li>\r\n	<li>epinard</li>\r\n	<li>carote</li>\r\n	<li>celerie-rave</li>\r\n	<li>betterave</li>\r\n	<li>panais</li>\r\n	<li>radis</li>\r\n	<li>navet</li>\r\n</ul>\r\n', '2022-06-26 13:05:33'),
(13, 0, 0, '[Variete ?][_Rien]<br><p>Culture d&#39;hiver :</p>\r\n\r\n<p>r&eacute;colte de novembre &agrave; mars</p>\r\n\r\n<ul>\r\n	<li>poireau,</li>\r\n	<li>vari&eacute;t&eacute; oignon</li>\r\n	<li>chou fris&eacute;</li>\r\n	<li>chou pomm&eacute;es</li>\r\n	<li>chou chinois pe tsai park choi tatsoi</li>\r\n	<li>mizuna</li>\r\n	<li>roquette</li>\r\n	<li>tan &ocirc;</li>\r\n	<li>chicor&eacute;</li>\r\n	<li>scarole</li>\r\n	<li>chicor&eacute; fris&eacute;</li>\r\n	<li>chicor&eacute; pain de sucre</li>\r\n	<li>salade d&#39;hiver :\r\n	<ul>\r\n		<li>laitue &agrave; couper</li>\r\n		<li>laitue romaine</li>\r\n		<li>laitue pomm&eacute;es</li>\r\n	</ul>\r\n	</li>\r\n	<li>roquette</li>\r\n	<li>m&acirc;che</li>\r\n	<li>moutarde</li>\r\n	<li>clayton de cuba cresson</li>\r\n	<li>epinard</li>\r\n	<li>carote</li>\r\n	<li>celerie-rave</li>\r\n	<li>betterave</li>\r\n	<li>panais</li>\r\n	<li>radis</li>\r\n	<li>navet</li>\r\n</ul>\r\n', '2022-06-26 13:06:59');
